(7, 'string', 'Settings', 'email_block', '<p><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">Уважаемый Пользователь!</span></span></p>\r\n<p><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">Ваша Учетная Запись, на сайте Оптового Комплекса "ЛЕГКИЙ ВЕТЕР",<br />заблокирована&nbsp;Администратором сайта по следующей причине: </span></span></p>\r\n<p>{%comment%}</p>', 1, '2017-05-08 12:26:13', '2019-05-22 12:30:08'),
(8, 'string', 'Settings', 'email_order', '<p><em><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">Уважаемый Пользователь!</span></span></em></p>\r\n<p><em><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">Ваш Заказ принят в обработку. Менеджеры Отдела Заказов свяжутся с Вами по телефону, сообщат точную сумму оплаты по Вашему Заказу и проинформируют о дальнейших действиях.</span></span></em></p>\r\n<p><a href="../../"><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">domopta.ru</span></span></a></p>', 1, '2017-05-08 12:26:13', '2019-05-21 08:14:42'),
(9, 'string', 'Settings', 'email_unblock', '<p><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">Уважаемый Пользователь!</span></span></p>\r\n<p><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">Ваша Учетная Запись разблокирована Администратором сайта Оптового Комплекса "ЛЕГКИЙ ВЕТЕР".</span></span></p>\r\n<p><a href="https://domopta.ru">domopta.ru</a></p>', 1, '2017-05-08 12:26:13', '2019-06-07 08:34:26'),
(10, 'string', 'Settings', 'email_delete', '<p><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">Уважаемый Пользователь!</span></span></p>\r\n<p><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">Ваша Учетная Запись удалена с сайта Оптового Комплекса "ЛЕГКИЙ ВЕТЕР"<br />(по решению Администратора сайта)</span></span></p>\r\n<p>&nbsp;</p>', 1, '2017-05-08 12:26:13', '2019-05-21 08:14:42'),
(11, 'string', 'Settings', 'email_confirm', '<p><span style="font-size: 14px;"><span style="font-family: trebuchet ms,helvetica,sans-serif;">Уважаемый Пользователь!</span></span></p>\r\n<p>Для подтверждения своей электронной почты на сайте Оптового Комплекса "ЛЕГКИЙ ВЕТЕР" Вам необходимо перейти по ссылке:</p>\r\n<p>{%link%}</p>', 1, '2017-05-08 12:26:13', '2019-06-07 08:41:37'),
